import React, { useState, useEffect } from 'react'
import LazyLoad from "react-lazyload";

const Gallery = () => {
  const [galleryImages, setImgageUrls] = useState([""])
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    populateWithImgUrls()

  },[])

  const populateWithImgUrls = () => {
    let imgUrlArray: any = []
    for(let x = 1; x <= 29; x++ ){
      imgUrlArray.push(`/assets/gallery/p${x}@2x.jpg`)
    }; 

    setImgageUrls(imgUrlArray)
  }

  return (
    <div className="gallery-container">
        <div className="wrapper">
          <ul className="gallery-grid">
            { galleryImages && galleryImages.map((img) => 
            <li key={img} className="img-wrapper">
              <div className="img-placeholder"></div>
              <img src={img} alt="Gallery Item" /> 
              <span className="img-hover">
                <button className="gallery-link"
                  >
                  <span className="btn-bg"></span>
                  <p>View photo</p>
                 </button>
              </span>

            </li>
            )}
          </ul>
        </div>
    </div>
  )
}

export default Gallery;
